import React, { useState, useRef, useEffect } from 'react';
import './StaticMap.css';

const StaticMap = ({ selectedProperty, onMapReady }) => {
  const mapRef = useRef(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [mapState, setMapState] = useState({
    center: { lat: 55.7558, lng: 37.6176 }, // –ú–æ—Å–∫–≤–∞
    zoom: 10,
    markers: []
  });

  // –ö–æ–æ—Ä–¥–∏–Ω–∞—Ç—ã –¥–ª—è –º–∞—Ä–∫–µ—Ä–æ–≤ –æ–±—ä—è–≤–ª–µ–Ω–∏–π
  const propertyMarkers = [
    { id: 1, lat: 55.5639, lng: 37.4839, type: "–î–æ–º", price: "11 000 000 –†" },
    { id: 2, lat: 55.4567, lng: 37.3123, type: "–î–æ–º", price: "15 495 200 –†" },
    { id: 3, lat: 55.7890, lng: 37.6789, type: "–ö–≤–∞—Ä—Ç–∏—Ä–∞", price: "8 500 000 –†" },
    { id: 4, lat: 55.7654, lng: 37.6543, type: "–ö–≤–∞—Ä—Ç–∏—Ä–∞", price: "12 300 000 –†" }
  ];

  useEffect(() => {
    // –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –∫–∞—Ä—Ç—ã
    setIsLoaded(true);
    if (onMapReady) {
      onMapReady({ 
        setView: (coords, zoom) => {
          setMapState(prev => ({
            ...prev,
            center: { lat: coords[0], lng: coords[1] },
            zoom: zoom || prev.zoom
          }));
        }
      });
    }
  }, [onMapReady]);

  useEffect(() => {
    if (selectedProperty) {
      // –¶–µ–Ω—Ç—Ä–∏—Ä—É–µ–º –∫–∞—Ä—Ç—É –Ω–∞ –≤—ã–±—Ä–∞–Ω–Ω–æ–º –æ–±—ä–µ–∫—Ç–µ
      setMapState(prev => ({
        ...prev,
        center: { lat: selectedProperty.lat, lng: selectedProperty.lng },
        zoom: 15
      }));
    }
  }, [selectedProperty]);

  const handleMarkerClick = (marker) => {
    console.log('–ö–ª–∏–∫ –ø–æ –º–∞—Ä–∫–µ—Ä—É:', marker);
  };

  const handleMapClick = (e) => {
    const rect = mapRef.current.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;

    // –ü—Ä–æ—Å—Ç–æ–µ –ª–æ–≥–∏—Ä–æ–≤–∞–Ω–∏–µ –∫–ª–∏–∫–∞ –ø–æ –∫–∞—Ä—Ç–µ
    console.log('–ö–ª–∏–∫ –ø–æ –∫–∞—Ä—Ç–µ:', { x, y });
  };

  return (
    <div className="map-container">
      <div className="map-header">
        <h3>–ö–∞—Ä—Ç–∞</h3>
        <div style={{ fontSize: '12px', color: '#666' }}>
          {isLoaded ? '–ö–∞—Ä—Ç–∞ –∑–∞–≥—Ä—É–∂–µ–Ω–∞' : '–ó–∞–≥—Ä—É–∑–∫–∞ –∫–∞—Ä—Ç—ã...'}
        </div>
      </div>
      <div 
        ref={mapRef} 
        className="static-map"
        onClick={handleMapClick}
      >
        {/* –§–æ–Ω –∫–∞—Ä—Ç—ã */}
        <div className="map-background">
          {/* –°–µ—Ç–∫–∞ –∫–∞—Ä—Ç—ã */}
          <div className="map-grid">
            {Array.from({ length: 20 }, (_, i) => (
              <div key={`h-${i}`} className="grid-line horizontal" style={{ top: `${i * 5}%` }} />
            ))}
            {Array.from({ length: 20 }, (_, i) => (
              <div key={`v-${i}`} className="grid-line vertical" style={{ left: `${i * 5}%` }} />
            ))}
          </div>

          {/* –ú–∞—Ä–∫–µ—Ä—ã –æ–±—ä—è–≤–ª–µ–Ω–∏–π */}
          {propertyMarkers.map((marker) => (
            <div
              key={marker.id}
              className={`map-marker ${selectedProperty?.id === marker.id ? 'selected' : ''}`}
              style={{
                left: `${((marker.lng - 37.0) / 1.0) * 100}%`,
                top: `${((55.9 - marker.lat) / 0.5) * 100}%`
              }}
              onClick={(e) => {
                e.stopPropagation();
                handleMarkerClick(marker);
              }}
            >
              <div className="marker-pin">
                <div className="marker-icon">üè†</div>
              </div>
              {selectedProperty?.id === marker.id && (
                <div className="marker-popup">
                  <div className="popup-content">
                    <div className="popup-title">{marker.type}</div>
                    <div className="popup-price">{marker.price}</div>
                  </div>
                </div>
              )}
            </div>
          ))}

          {/* –¶–µ–Ω—Ç—Ä –∫–∞—Ä—Ç—ã */}
          <div 
            className="map-center"
            style={{
              left: `${((mapState.center.lng - 37.0) / 1.0) * 100}%`,
              top: `${((55.9 - mapState.center.lat) / 0.5) * 100}%`
            }}
          />
        </div>

        {/* –≠–ª–µ–º–µ–Ω—Ç—ã —É–ø—Ä–∞–≤–ª–µ–Ω–∏—è –∫–∞—Ä—Ç–æ–π */}
        <div className="map-controls">
          <div className="zoom-controls">
            <button 
              className="zoom-btn"
              onClick={() => setMapState(prev => ({ ...prev, zoom: Math.min(prev.zoom + 1, 18) }))}
            >
              +
            </button>
            <button 
              className="zoom-btn"
              onClick={() => setMapState(prev => ({ ...prev, zoom: Math.max(prev.zoom - 1, 1) }))}
            >
              ‚àí
            </button>
          </div>
        </div>

        {/* –ò–Ω—Ñ–æ—Ä–º–∞—Ü–∏—è –æ –º–∞—Å—à—Ç–∞–±–µ */}
        <div className="map-info">
          <div className="zoom-level">–ú–∞—Å—à—Ç–∞–±: {mapState.zoom}</div>
          <div className="coordinates">
            {mapState.center.lat.toFixed(4)}, {mapState.center.lng.toFixed(4)}
          </div>
        </div>
      </div>
    </div>
  );
};

export default StaticMap;
